import React, { Component } from "react";
import Head from "next/head";
class SlideShow extends Component {
    render() {
        return (
            <div>
                <Head>
                    <link rel="stylesheet" href="css/reveal.css" />
                    <link rel="stylesheet" href="css/theme/white.css" />
                </Head>              
            </div>
        )
    }
}

export default SlideShow;
